    line-height: 1.2;
    font-family: 'HG正楷書体-PRO',serif,'Tahoma', 'Arial';
    color: 555555;
}

div.top-brandbutton {
border-style:solid;
border-color:blue;
border-width:0px;
padding: 1px 0px 0px 0px;
width:145px;
